(6, -1, '注册协议', '<p>本网站不支持在线购物，如果您看中商品，直接联系公司客服，感谢您的关注</p>', '', '', '', 0, 1, 1536835791, '', 0, 'http://', '', '0', '', 0),
(19, 9, '联系我们', '<p>&nbsp;网站测试中。。。。。。</p>', '', '', '', 0, 1, 1593935001, '', 0, 'http://', '', '0', NULL, 0),
(11, -1, '关于我们', '<p>&nbsp;网站测试调整中。。。本网站不支持在线购物，仅为商品展示。</p>', '', '', '', 0, 1, 1536835791, '', 0, 'http://', '', '0', '', 0),
(17, 5, '订购方式', '<p>&nbsp;<span style=\"color: rgb(85, 85, 85); font-family: &quot;microsoft yahei&quot;;\">本网站，不支持在线购买，如果看中商品，可联系公司客服。确认商品后，一个电话就可以搞定。</span></p>', '', '', '', 0, 1, 1593934388, '', 0, 'http://', '', '0', '', 0),
(16, 7, '配送区域', '<p>&nbsp;本网站，不支持在线购买，如果看中商品，可联系公司客服。</p>\r\n<p>上海市内免费送货，外地为顺丰快递或德邦物流。</p>', '', '', '', 0, 1, 1593933971, '', 0, 'http://', '', '0', NULL, 0),
(15, 7, '支付方式', '<p>&nbsp;本网站，不支持在线购买，如果看中商品，可联系公司客服，支付方式为：公对公转账。</p>', '', '', '', 0, 1, 1593933887, '', 0, 'http://', '', '0', NULL, 0),
(12, 10, '免责申明', '<p>网站测试中。。。。网上信息很多不对，联系方式也不对。最近网站公司还在调整中，，，如果问题，敬请原谅！</p>\r\n<p>本网站商品，仅供展示，不支持在线购物，网站上不产生任何费用</p>\r\n<p>关于商品价格：展示商品价格，仅供参考，实际价格请联系您的客服经理。</p>\r\n<p>关于商品内容：商品信息大部分由品牌方或供应商提供，部分产品公司拍摄，部分产品可能源于网络，如果图片侵权，请随时联系我们删除，021-58950818，</p>\r\n<p>&nbsp;</p>', '', '', '', 1, 1, 1593835131, '', 0, 'http://', '申明', '0', '', 0),
(14, 8, '售后服务', '<p>&nbsp;售后服务，请联系您的服务经理。</p>', '', '', '', 0, 1, 1593933736, '', 0, 'http://', '', '0', NULL, 0),
(13, 9, '投诉建议', '<p>&nbsp;<span style=\"color: rgb(85, 85, 85); font-family: &quot;microsoft yahei&quot;;\">&nbsp;网站测试中，如果有意见，可联系我们，感谢您的关注。</span></p>', '', '', '', 0, 1, 1593933656, '', 0, 'http://', '', '0', '', 0),
(18, 5, '订购流程', '<p>&nbsp;看中商品-----联系客服-----确认商品------预约送货时间地址------客服准备出货单及发票--------货到付款------售后回访。</p>', '', '', '', 0, 1, 1593934532, '', 0, 'http://', '', '0', NULL, 0),
(20, 21, '魔幻丹东的草莓自由', '<p>在许多人眼中，丹东是朝鲜不可分割的一部分。<br />\r\n<br />\r\n丹东有很多外号，什么北方三亚、东北香港、东亚夏威夷&hellip;这些外号多半都是丹东市政府和房地产商自己想出来的，前几年趁着金正恩首次访华他们甚至打出了&ldquo;前有深圳，后有雄安，而今看丹东&rdquo;这样堪称僭越的口号。然而很长一段时间，在大多数外省人眼中，这个城市唯一剩下的标签就是朝鲜。除了去朝鲜旅游或者观看抗美援朝影视作品的时候，丹东这两个字几乎不会出现在人们的日常生活中。</p>\r\n<p>鲜为人知的是，除了朝鲜，还有另一个国家和丹东关系密切，那就是大海另一边的日本。1905年日本人在日俄战争中取胜，丹东从此成为日本人的势力范围。1914年（民国三年）设立东边道，首府驻地安东，按照中国人和日本人活动区域，将安东划分为日本市场（七道沟）和中国市场（聚宝、中富），形成了现在丹东的雏形。时至今日丹东与日本的经济和文化交流依然频繁，丹东有最正宗的鳗鱼饭和日式浴场，也有每年三月的樱花烂漫，如果这些你都没有听说过的话，丹东还有一样源自日本的东西现在已经火遍全国&mdash;&mdash;东港草莓。</p>\r\n<p style="text-align: center;"><img src="/images/upload/Image/caomei1.jpg" alt="" width="671" height="376" />&nbsp;</p>\r\n<p style="text-align: left;">一直以来，草莓被人们视为一种高端水果。但是如果你在每年的1月~5月之间造访丹东，你可能会因为眼前的魔幻现实而怀疑人生：这里到处都是卖草莓的地摊和卡车，许多市民都会每天习惯性的买两三斤回家当零食，每天卖剩的草莓还会在第二天以极低的价格处理掉。如果你有机会走进东港的草莓大棚，情况更是触目惊心，大批大批只是稍有瑕疵的草莓就因为不能承受长途运输而被随意丢弃。如果你问当地人，为什么不自己吃掉这些草莓呢，那你大概率会被他们当成外星人。</p>\r\n<p style="text-align: center;"><img src="/images/upload/Image/caomei2.jpg" alt="" width="674" height="385" /></p>\r\n<p style="text-align: left;">东港草莓颜值极高，果实呈圆锥形，果面平整，外形美观，果面和内部色泽均呈鲜红色，着色一致，极少出现空心，果实通体红色，富有光泽，而且最重要的是她大，个头普遍是一般草莓的两倍，把东港草莓和普通草莓摆在一起，就像看到了板门店朝韩领导人同框合影一样。这里的草莓和星巴克的咖啡一样，没有小杯，只有中杯大杯和特大杯。</p>\r\n<p style="text-align: center;"><img src="/images/upload/Image/caomei3.jpg" alt="" width="674" height="433" /></p>\r\n<p style="text-align: left;">虽然&ldquo;红颜草莓&rdquo;的种植难度较大，有一定的技术壁垒。但和许多人想象中不同的是，这种草莓的产量其实很高，且得益于花芽分化能力强，连续结果性也很好。并且她克服了&ldquo;章姬草莓&rdquo;果实软的弱点。继承了  &ldquo;幸香草莓&rdquo;的硬度高、耐存储的优点。可以进行长途运输，更适合线上销售。</p>', '', '', '', 0, 1, 1669801100, '', 0, 'http://', '东港草莓颜值极高，果实呈圆锥形，果面平整，外形美观，果面和内部色泽均呈鲜红色，着色一致，极少出现空心，果实通体红色，富有光泽，而且个头普遍是一般草莓的两倍。', '0', 'data/article/1669801111406381712.jpg', 0);
