(1, 0, 136, 'test@test.com', 'test', '这是我网购以来最满意的一个商品，比我预期的要好很多，外观颜值、产品功能都非常出色，五星推荐哦很好的购买平台，质量不错，特别是有品牌的，值得信赖到货就迫不及待打开了，果真没有让我失望，质量特别好，颜值也相当高，满意的一次购物价格很实惠，性价比很高，算是平价好物，会回购的正品，买的放心，价钱也公道，满意！当时买的时候还在犹豫价格，买来之后一点都不后悔，而且物流还快，可以入手特别特别棒，货比三家才买的，店主人很好，回答问题很有耐心，也很详细，有需要还会再来的本来还很担心东西不好，拿到手发现完全多虑了，五星好评趁着活动入手划算，发货快，包装得好，非常不错，全新体验，赞赞赞！', 5, 1669805002, '192.168.2.1', 1, 0, 2, 0, 0);
